DROP TABLE IF EXISTS `etcitem`;
CREATE TABLE `etcitem` (
  `item_id` smallint(4) unsigned NOT NULL default '0',
  `name` varchar(128) NOT NULL default '',
  `additional_name` varchar(128) NOT NULL,
  `class` enum('CONSUMABLE','MISC','EQUIPMENT','MATHERIALS','OTHER','PIECES','RECIPIES','SPELLBOOKS') NOT NULL default 'OTHER',
  `crystallizable` enum('false','true') NOT NULL default 'false',
  `item_type` varchar(12) NOT NULL default '',
  `weight` int(11) NOT NULL default '0',
  `consume_type` varchar(12) NOT NULL default '',
  `crystal_type` enum('none','d','c','b','a','s','s80','s84') NOT NULL default 'none',
  `durability` int(11) NOT NULL default '0',
  `temporal` tinyint(1) unsigned NOT NULL default '0',
  `price` int(11) unsigned NOT NULL default '0',
  `crystal_count` int(11) NOT NULL default '0',
  `sellable` enum('false','true') NOT NULL default 'true',
  `skill_id` varchar(20) NOT NULL default '0',
  `skill_level` varchar(12) NOT NULL default '1',
  `icon` varchar(128) NOT NULL default '',
  `dropable` tinyint(1) NOT NULL default '1',
  `destroyable` tinyint(1) NOT NULL default '1',
  `tradeable` tinyint(1) NOT NULL default '1',
  `flags` int(10) unsigned NOT NULL default '0',
  PRIMARY KEY  (`item_id`),
  KEY `class` (`class`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

